import React from "react";
function navbar(currentPage,){
    return(
        <div class="navbar">
        <a href="#about" onClick={renderPage("about")}>About Me</a>
        <a href="#portfolio">Portfolio</a>
        <a href="#contact">Contact Me</a>
        <a href="#resume">Resume</a>
        
    </div>
    )
}
export default navbar;
